offers.description:
Машина в идеальном состоянии, не битая, любые проверки, чистый карфакс.
Год в эксплуатации в РФ, полёт отличный.
У кого не было электромобиля, рассказываю о преимуществах этой машинки:
1. Бесплатные городские парков в том числе в Москве и Питере.
2. Отсутсвие транспортного налога в М.О.;
3. Затраты на поездку на аккумуляторе 120км за 70₽;
4. Если разряжается аккумулятор в этой машине встроен бензиновый генератор который автоматически включается и заряжает аккумулятор и позволяет на баке в 7 литров проехать ещё до 120км;
5. Уникальный дизайн интерьера и экстерьера;
6. Маленький радиус разворота;
7. Камера заднего вида и функция параллельной автоматической парковки;
8. Разгон за 7,2 секунды до сотни.
9. Обслуживание у официальных дилеров BMW;
10. Русский интерфейс и последняя версия навигационных карт.
В общем полноценная городская машина для 4-х человек, очень удобно с детьми.
Запас хода на батарее летом около 120 км, зимой около 90 км.
Ездила жена. В комплекте родная зарядка от 220В. В подарок кабель для зарядки на Московских зарядках и карточка МОЭК.
2 ключа. Цена минимальная. Своевременное обслуживание. Пройдены все ТО. Куплена не в кредит. Непрокуренный салон. Не участвовала в ДТП.
